import React from 'react';
import { Switch, Route, BrowserRouter as Router  } from  'react-router-dom'
import 'bootstrap/dist/css/bootstrap.min.css';
import NaviBar from "./Components/NaviBar";
import About from "./Pages/About";
import Rent from "./Pages/Rent";
import DetailedTruck from "./Pages/DetailedTruck";
import {withRouter} from 'react-router';




function App() {

    const el = ("Ford", 16, 10000, "https://s1.1zoom.ru/big0/187/302174-Berserker.jpg")
    const props = [el, el, el, el]

    return (
            <Router>
                <React.StrictMode>
                    <NaviBar/>
                    <Switch>
                        <Route exact path="/about" component={withRouter(About)}/>
                        <Route exact path="/" component={withRouter(Rent)}/>
                        <Route path="rent/:id" component={withRouter(DetailedTruck)}/>
                    </Switch>
                </React.StrictMode>
            </Router>

);
}

export default App;
